import React from 'react';
import infologo from '../../assets/personal-info.jpg';

const Jachaikoron = () => {
    return (
        <div className='mx-auto max-w-3xl min-h-screen m'>
           <div>
            <img src={infologo} alt="" />
           </div>
        </div>
    );
};

export default Jachaikoron;
